import React from 'react';
import './GreenAndWhiteScreen.css';

const GreenAndWhiteScreen = () => {
  return (
    <div className="green-screen">
      <div className="white-box">
        {/* Your content goes here */}
        <p>This is white content inside a green box.</p>
      </div>
    </div>
  );
};

export default GreenAndWhiteScreen;
